import React, { useEffect, useState } from "react"
import styled from "styled-components"
import { Link } from "react-router-dom"
import FILE1 from "../components/files/file1"
import axios from "axios"
import { sendData } from "../server"

const Container = styled.div``
const Table = styled.table`
  margin: -50px;
  padding: 0;
`
const Tr = styled.tr`
  border: 1px solid #fff;
`
const Th = styled.th`
  border: 1px solid #fff;
`
const Td = styled.td`
  border: 1px solid #fff;
`
const Button = styled.button`
  position: fixed;
  top: 20px;
  right: 20px;
`
const Home = () => {
  const [data, setData] = useState([])

  useEffect(() => {
    fetch("https://traveol.herokuapp.com/api/contact")
      .then((response) => response.json())
      .then((json) => setData(json))
      .catch((err) => console.log("Request Failed", err))
  }, [])

  const backgroundSync = () => {
    navigator.serviceWorker.ready.then((swRegistration) =>
      swRegistration.sync.register("post-data").catch((err) => console.log(err))
    )
  }
  const sendData = (data) => {
    fetch("https://traveol.herokuapp.com/api/contact", {
      method: "POST",
      body: JSON.stringify(data),
      headers: { "Content-type": "application/json; charset=UTF-8" },
    })
      .then((response) => response.json())
      .then((json) => console.log(json))
      .catch((err) => {
        console.log(err)
        backgroundSync()
      })
  }
  const handleAdd = () => {
    sendData({
      name: "dy",
      email: "dy@gcalls.vn",
    })
  }
  const handleDelete = () => {}

  return (
    <Container>
      <Button onClick={handleAdd}>add</Button>
      <Table border={1}>
        <Tr>
          <Th>ID</Th>
          <Th>name</Th>
          <Th>email</Th>
          <Th>content</Th>
          <Th>created at</Th>
        </Tr>
        {data.length >= 0 &&
          data.map((item) => (
            <Tr key={item.audioID}>
              <Td>
                <Link to={`audioID=${item._id}`}>{item._id}</Link>
              </Td>
              <Td>{item._id}</Td>
              <Td>{item.name}</Td>
              <Td>{item.email}</Td>
              <Td>{item.content}</Td>
              <Td>{item.createdAt}</Td>
              <Td>
                <button onClick={handleDelete}>X</button>{" "}
              </Td>
            </Tr>
          ))}
      </Table>
      {/* <Table border={1}>
        <Tr>
          <Th>ID voice</Th>
          <Th>ID Agent</Th>
          <Th>Agent name</Th>
          <Th>ID Customer</Th>
          <Th>Customer name</Th>
          <Th>date</Th>
          <Th>call hold duration</Th>
          <Th>call duration</Th>
        </Tr>
        {data.length >= 0 &&
          data.map((item) => (
            <Tr key={item.audioID}>
              <Td>
                <Link to={`audioID=${item.audioID}`}>{item.audioID}</Link>
              </Td>
              <Td>{item.audioCredit.agent.agentID}</Td>
              <Td>{item.audioCredit.agent.name}</Td>
              <Td>{item.audioCredit.customer.customerID}</Td>
              <Td>{item.audioCredit.customer.name}</Td>
              <Td>{item.audioCredit.date}</Td>
              <Td>{item.audioCredit.callHoldDration}</Td>
              <Td>{item.audioCredit.callDuration}</Td>
              <Td>
                <button onClick={handleDelete}>X</button>{" "}
              </Td>
            </Tr>
          ))}
      </Table> */}
    </Container>
  )
}

export default Home
